import streamlit as st
st.set_page_config(page_title='Cats')
st.header("Types of cats")
col1,col2,col3=st.columns(3)
with col1:
  st.subheader("Persian Cat")
  st.image("data:image/jpeg;base64,",caption="Persian Cat",width=300,use_column_width=True)
  st.write("Persian cats are cute")
with col2:
  st.subheader("Ragdoll Cat")
  st.image("data:image/jpeg;base64,",caption="Ragdoll Cat",width=300,use_column_width=True)
  st.write("Ragdoll cats are proud")
with col3:
  st.subheader("Indian Cat")
  st.image("https://www.godigit.com/content/dam/godigit/directportal/en/cat-/image.jpeg",caption="Indian Cat",width=300,use_column_width=True)
  st.write("Indian cats are royal")
